def modinv(a, m)
  m0, inv, x0 = m, 1, 0
  while a > 1
    inv -= (a / m) * x0
    a, m, inv, x0 = m, a % m, x0, inv
  end
  inv % m0
end

def dfs(p, q, depth)
  10.times do |x|
    10.times do |y|
      next if depth == 0 && y < x
      pp = x.to_s + p
      qq = y.to_s + q
      xi = pp.unpack1('H*').hex
      yi = qq.unpack1('H*').hex
      if (xi * yi) % (2 ** ((depth + 1) * 8)) == N % (2 ** ((depth + 1) * 8))
        if N % xi == 0
          return [xi, yi]
        end
        res = dfs(pp, qq, depth + 1)
        unless res.nil?
          return res
        end
      end
    end
  end
  nil
end

p, q = dfs('', '', 0)
phi = (p - 1) * (q - 1)
d = modinv(65537, phi)
puts [c.pow(d, N).to_s(16)].pack('H*')
